  `labs_planned` int(11) DEFAULT NULL,
  `disciplines` varchar(128) DEFAULT NULL,
  `experiments_conducted` int(11) DEFAULT NULL,
  `other_details` varchar(128) DEFAULT NULL,
  `cancellation_reason` varchar(128) DEFAULT NULL,
  `not_approval_reason` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `status_id` (`status_id`),
